    def validate_enc_input(self, value):
        """驗證二次加密输入（0-9）"""
        return re.match("^[0-9]?$", value) is not None

    def create_input_fields(self):
        """動態生成输入字段"""
        for widget in self.input_frame.winfo_children():
            widget.destroy()
        
        cols = 6
        rows = self.word_count.get() // cols + (1 if self.word_count.get()%cols else 0)
        self.num_entries = []
        
        for i in range(self.word_count.get()):
            row = i // cols
            col = i % cols
            frame = tk.Frame(self.input_frame)
            frame.grid(row=row, column=col, padx=3, pady=3)
            tk.Label(frame, text=f"{i+1:02d}:").pack(side=tk.LEFT)
            entry = tk.Entry(frame, width=7, validate="key", 
                           validatecommand=(frame.register(self.validate_number), '%P'))
            entry.pack(side=tk.LEFT)
            self.num_entries.append(entry)

    def validate_number(self, text):
        """驗證输入為數字且不超過5位"""
        return re.match("^[0-9]{0,5}$", text) is not None

    def update_input_fields(self, event=None):
        self.create_input_fields()

    def encrypt(self):
        """執行加密操作（V1.0）"""
        # 输入驗證
        inputs = []
        for entry in self.num_entries:
            num = entry.get().zfill(5)
            if len(num) !=5:
                messagebox.showerror("錯誤", "請输入有效的5位数字")
                return
            inputs.append(num)
        
        try:
            order_pos = self.order_pos.get()
            if not 1 <= order_pos <=6:
                raise ValueError("顺序位置需在1-6之间")
            
            # 驗證二次加密数值
            sec_enc = [int(v.get()) for v in self.sec_enc_values]
            if any(not 0 <= num <=9 for num in sec_enc):
                raise ValueError("二次加密數值需在0-9之间")
                
        except ValueError as e:
            messagebox.showerror("輸入錯誤", str(e))
            return

        # 加密處理
        results = []
        for group_index, number in enumerate(inputs, 1):
            # 拆分數字為兩位數
            digits = [f"{int(d):02d}" for d in number]
            
            # 插入順序值（組號）
            order_num = f"{group_index:02d}"
            digits.insert(order_pos-1, order_num)
            
            # 二次加密（使用全部6個加密值）
            if len(digits) != 6:
                messagebox.showerror("錯誤", "加密流程異常，請聯繫開發者")
                return
                
            encrypted = []
            for i in range(6):
                original = int(digits[i])
                encrypted_val = (original + sec_enc[i]) % 100
                encrypted.append(f"{encrypted_val:02d}")
            
            results.append(encrypted)
        
        self.last_result = results
        self.show_results(results)

    def show_results(self, results):
        """顯示加密结果"""
        self.result_text.delete(1.0, tk.END)
        for idx, group in enumerate(results, 1):
            line = f"{idx:02d}. {' '.join(group)}"
            self.result_text.insert(tk.END, line + '\n')
            
    def to_letters(self):
        """轉換為字母形式（V1.0）"""
        if not hasattr(self, 'last_result'):
            return
        
        try:
            offset = self.offset.get()
            if not 0 <= offset <=25:
                raise ValueError("偏移值需在0-25之间")
        except ValueError as e:
            messagebox.showerror("錯誤", str(e))
            return
        
        self.result_text.delete(1.0, tk.END)
        
        for idx, group in enumerate(self.last_result, 1):
            letters = []
            for num in group:
                n = (int(num) + offset) % 26
                letters.append(chr(n + ord('A')))
            
            line = f"{idx:02d}. {''.join(letters)}"
            self.result_text.insert(tk.END, line + '\n')

    def show_pdf_guide(self):
        """顯示PDF說明文件"""
        try:
            # 生成臨時文件
            pdf_data = base64.b64decode(self.BASE64_DATA)
            temp_dir = tempfile.gettempdir()
            pdf_path = os.path.join(temp_dir, "Number-seed-conversion.pdf")
            
            with open(pdf_path, "wb") as f:
                f.write(pdf_data)
            
            # 打開文件
            if platform.system() == 'Windows':
                os.startfile(pdf_path)
            else:
                webbrowser.open(pdf_path)
                
        except Exception as e:
            messagebox.showerror("錯誤", f"無法打開PDF文件: {str(e)}")

